CREATE TABLE DISTRITOS(
     IDDISTRITO  NCHAR(5) PRIMARY KEY ,
      DESCRIPCION NCHAR(30)UNIQUE NOT NULL
 );
 
 CREATE TABLE MARCAS(
    IDMARCA NCHAR(5) PRIMARY KEY ,
    DESCRIPCION NCHAR(30) UNIQUE NOT NULL
);

CREATE TABLE CATEGORIAS(
    IDCATEGORIA  NCHAR(5) PRIMARY KEY,
    NOMBRECATEGORIA NCHAR(40) UNIQUE
 );
 
CREATE TABLE SUBCATEGORIAS(
    IDSUBCATEGORIA  NCHAR(5) PRIMARY KEY,
    IDCATEGORIA  NCHAR(5) REFERENCES  CATEGORIAS(IDCATEGORIA) ,
    NOMBRESUBCATEGORIA NCHAR(50) UNIQUE
);

CREATE TABLE ESTADOSPEDIDOS (
  IDESTADOPEDIDO NCHAR(5) PRIMARY KEY,
  DETALLE NCHAR(40) UNIQUE
);

 CREATE TABLE CARGOS(
    IDCARGO NCHAR(5) PRIMARY KEY ,
    DESCRIPCION  NCHAR(15) UNIQUE
);

CREATE TABLE TIPOCOMPRA(
    IDCOMPRA NCHAR(5) PRIMARY KEY,
    NOMBRECOMPRA  NCHAR(15) UNIQUE
);

CREATE TABLE EMPLEADOS(
    IDEMPLEADO NCHAR(10) PRIMARY KEY,
    NOMBRES NCHAR(30) NOT NULL,
    APELLIDOPATERNO NCHAR(30) NOT NULL,
    APELLIDOMATERNO NCHAR(50) NOT NULL,
    FECHANACIMIENTO DATE NOT NULL,
    SEXO CHAR(1) CHECK (SEXO IN ('M','F')),
    ESTADOCIVIL CHAR(1) CHECK (ESTADOCIVIL IN ('C','V','S','D')),
    DNI CHAR(8) UNIQUE,
    DIRECCION NCHAR(55) NOT NULL,
    EMAIL NCHAR(90)NOT NULL, 
    TELEFONOS NCHAR(15) NOT NULL,
    CELULAR NCHAR(15) NOT NULL,
    SUELDO NUMBER(8,2) NOT NULL,
    FECHACONTRATACION DATE NOT NULL,
    FECHASALIDA DATE  NULL,
    IDCARGO NCHAR(5) REFERENCES  CARGOS(IDCARGO),
    IDDISTRITO NCHAR(5) REFERENCES  DISTRITOS(IDDISTRITO)    
 );
 
 CREATE TABLE PROVEEDORES(
      IDPROVEEDOR NCHAR(5) PRIMARY KEY,
      RAZONSOCIAL NCHAR(40) NOT NULL,
      RUC CHAR(11) UNIQUE,
      DIRECCION NCHAR(55) NOT NULL,
      TELEFONOS NCHAR(25) NOT NULL,
      WEB VARCHAR2(40)NOT NULL, 
      EMAIL VARCHAR2(40)NOT NULL,      
      IDDISTRITO NCHAR(5) REFERENCES  DISTRITOS(IDDISTRITO)      
);
    
CREATE TABLE CLIENTES(
    IDCLIENTE NCHAR(5) PRIMARY KEY,
    NOMBRECLIENTE NCHAR(100) NOT NULL,
    FECHANACIMIENTO DATE NOT NULL,
    SEXO CHAR(1) CHECK (SEXO IN ('M','F')),
    ESTADOCIVIL CHAR(1) CHECK (ESTADOCIVIL IN ('C','V','S','D')),
    DNI CHAR(8) UNIQUE,
    DIRECCION NCHAR(55) NOT NULL,
    EMAIL NCHAR(40)NOT NULL, 
    TELEFONOS NCHAR(25) NOT NULL,
    CELULAR NCHAR(25) NOT NULL,     
    IDDISTRITO NCHAR(5) REFERENCES  DISTRITOS(IDDISTRITO)
);

CREATE TABLE PRODUCTOS(    
     IDPRODUCTO NCHAR(10) PRIMARY KEY,
     NOMBREPRODUCTO NCHAR(40) NOT NULL,       
     STOCKACTUAL  NUMBER NULL,
     STOCKMINIMO  NUMBER NULL,      
     PESO NVARCHAR2 (5) NULL,
     IDMARCA NCHAR(5) REFERENCES  MARCAS(IDMARCA ),
     IDPROVEEDOR NCHAR(5) REFERENCES  PROVEEDORES(IDPROVEEDOR),    
     IDSUBCATEGORIA  NCHAR(5) REFERENCES SUBCATEGORIAS(IDSUBCATEGORIA),
     PRECIOPROVEEDOR      NUMBER(10,2)  NOT NULL,
     DESCONTINUADO        NUMBER
);

CREATE TABLE VENTAS(
  IDVENTA NCHAR(10) PRIMARY KEY,
  IDVENDEDOR  NCHAR(10) REFERENCES EMPLEADOS(IDEMPLEADO),		
  IDCAJERO  NCHAR(10) REFERENCES EMPLEADOS(IDEMPLEADO),		
  IDDESPACHADOR  NCHAR(10) REFERENCES EMPLEADOS(IDEMPLEADO),		
  IDCLIENTE  NCHAR(5) REFERENCES CLIENTES(IDCLIENTE),		   
  IDCOMPRA NCHAR(5) REFERENCES  TIPOCOMPRA(IDCOMPRA),  
  FECHAVENTA DATE NOT NULL,
  FECHAPAGO DATE NOT NULL,  
  IMPORTE NUMBER(10,2) NOT NULL
);

CREATE TABLE DETALLEVENTAS(
   IDVENTA NCHAR(10) REFERENCES VENTAS(IDVENTA),
   IDPRODUCTO NCHAR(10) REFERENCES PRODUCTOS(IDPRODUCTO),
   PRECIO NUMBER(10,2) NOT NULL,
   CANTIDAD NUMBER ,
   DESCUENTO NUMBER(10,2) NOT NULL
);
 










